        /// <summary>
        ///     将数据输出到文本文件
        /// </summary>
        /// <param name="data">数据</param>
        /// <param name="filename">文本文件名</param>
        private static void ToTxtFile( IEnumerable<double> data, string filename )
        {
            OutputUtils.ToTxtFile(data, filename);
        }

        private static void DoDirectCorrelate( double[] xArray, double[] yArray, double fs )
        {
            double[] rxy, rxx;
            double[] tau;
            double dt = 1 / fs;

            ToTxtFile( xArray, "xArray.txt" );

            ToTxtFile( yArray, "yArray.txt" );

            // 互相关
            DSPBasic.FastCorrelate( xArray, yArray, dt, out rxy, out tau );

            ToTxtFile( rxy, "rxy.txt" );

            ToTxtFile( tau, "tau.txt" );

            // 互相关
            DSPBasic.FastCorrelate( xArray, xArray, dt, out rxx, out tau );

            ToTxtFile( rxx, "rxx.txt" );

            var rxy_1 = new double[Math.Min( xArray.Length, yArray.Length )];
            ArrayUtils.Copy( rxy, rxy_1, 0, rxy_1.Length );

            // 互谱
            double[] rxyAmpSpectrum, rxyPhaseSpectrum;
            int fftLength;
            Correlate.CrossSpectrum( xArray, yArray, out rxyAmpSpectrum, out rxyPhaseSpectrum, out fftLength );
            //double[] rxyAmpSpectrum = SpectrumBasic.AmpSpectrum( rxy_1 );
            ToTxtFile( rxyAmpSpectrum, "rxyAmpSpectrum.txt" );

            //double[] rxyPhaseSpectrum = SpectrumBasic.PhaseSpectrum( rxy_1 );
            ToTxtFile( rxyPhaseSpectrum, "rxyPhaseSpectrum.txt" );

            ArrayUtils.Copy( rxx, rxy_1, 0, rxy_1.Length );
            //rxyAmpSpectrum = SpectrumBasic.AmpSpectrum(rxy_1);
            //rxyPhaseSpectrum = SpectrumBasic.PhaseSpectrum(rxy_1);
            Correlate.CrossSpectrum( xArray, xArray, out rxyAmpSpectrum, out rxyPhaseSpectrum, out fftLength );

            ToTxtFile( rxyAmpSpectrum, "rxxAmpSpectrum.txt" );
            ToTxtFile( rxyPhaseSpectrum, "rxxPhaseSpectrum.txt" );

            double[] coherence;
            //Correlate.FastCoherence( xArray, yArray, out coherence, out fftLength );
            coherence = Correlate.DirectCoherence( xArray, yArray );
            ToTxtFile( coherence, "coherence.txt" );

            double[] freqResponseAmpSpectrum, freqResponsePhaseSpectrum;
            Correlate.FastFrequenceResponse( xArray, yArray, out freqResponseAmpSpectrum,
                                             out freqResponsePhaseSpectrum, out fftLength );
            ToTxtFile( freqResponseAmpSpectrum, "freqResponseAmpSpectrum.txt" );
            ToTxtFile( freqResponsePhaseSpectrum, "freqResponsePhaseSpectrum.txt" );
        }

        /// <summary>
        ///     测试“相关”程序，输入正弦波，输出正弦波
        ///     思路：先输出到文本文件，然后使用matlab加载文本文件并画图，对比
        /// </summary>
        [Test]
        public void DirectCorrelate()
        {
            double[] sinWave = SignalGenerator.CreateSin( new CreateSinParameter {DataLength = 32, F0 = 1, Fs = 16} );
            double[] x = sinWave;
            double[] y =
                SignalGenerator.CreateSin( new CreateSinParameter
                    {
                        DataLength = 32,
                        F0 = 1,
                        Fs = 16,
                        InitPhaseInDegree = 180
                    } );
            double fs = 16;

            DoDirectCorrelate( x, y, fs );
        }

